import React from "react";

export function Sidebar(props) {
  return (<div className="sidebar">
    <div className="icon"> <img src={props.homeIcon} alt="Principal" /> </div>
    <div className="icon"> <img src={props.fireIco} alt="Tendencias" /> </div>
    <div className="icon"> <img src={props.subscriptionIcon} alt="Suscripciones" /> </div>
    <div className="icon"> <img src={props.logo} alt="Biblioteca" /> </div>
  </div>)
}
